(1, '<div class="who-we-are">\r\n<p><img src="<?php print base_path();?><?php print path_to_theme() . ''/images/img-who-we-are.png'';?>"/></p>\r\n<p>We have a total of 25+ years combined experience dealing exclusively with New York buyers and sellers. Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>\r\n<p><a href="#" title="View more" class="btn btn-view-more">View more</a></p>\r\n</div>', 'Who We Are', 'php_code'),
(2, '<p>Pellentesque nec erat. Aenean semper, neque non faucis. Malesuada, dui felis tempor felis, vel varius ante diam ut mauris. </p>\r\n<address class="contact-info">\r\n<p><i class="fa fa-phone"></i>Office: 1-800-666-8888</p>\r\n<p><i class="fa fa-mobile-phone"></i>Mobile: 0800-666-6666</p>\r\n<p><i class="fa fa-phone-square"></i>Fax: 1-800-666-8888</p>\r\n<p><i class="fa fa-envelope-o"></i>Mail: <a href="#" title="support@weebpal.com">support@weebpal.com</a></p>\r\n</address>', 'Contact detail', 'full_html'),
(3, '<p>Powered by <a target="_blank" href="http://drupal.org">Drupal</a> | Developed by <a target="_blank" href="http://weebpal.com">WeebPal</a> | Designed by <a target="_blank" href="http://pixelgeeklab.com">PixelGeekLab</a><br>All Rights Reserved.</p>', 'Copyright', 'full_html'),
(4, '<ul class="social-list">\r\n<li><a title="Login" href="#" class="fa fa-user"><span>Login</span></a></li>\r\n<li><a title="Email" href="#" class="fa fa-envelope-o"><span>Email</span></a></li>\r\n<li><a title="Facebook" href="#" class="fa fa-facebook"><span>Facebook</span></a></li>\r\n<li><a title="Twitter" href="#" class="fa fa-twitter"><span>Twitter</span></a></li>\r\n<li><a title="Google+" href="#" class="fa fa-google-plus"><span>Google+</span></a></li>\r\n</ul>', 'Socials', 'full_html'),
(5, '<i class="fa fa-phone"></i>Need Support? 1-800-666-8888', 'Support', 'full_html'),
(6, '<div class="contact-content contact-content-full">\r\n	<div class="contact-intro">\r\n		<h3>ALOHA!</h3>\r\n		<p>Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto.</p>\r\n	</div>\r\n	<div class="row">\r\n		<div class="col-md-4">\r\n			<h4><i class="fa fa-map-marker"></i> United states</h4>\r\n			<address>5th Avenue, 10019 New York, United States<br>+1 310 666 8888<br>+1 310 666 9999<br><a href="mailto:store_1@companyname.com">store_1@companyname.com</a></address>\r\n		</div>\r\n		<div class="col-md-4">\r\n			<h4><i class="fa fa-map-marker"></i> Canada</h4>\r\n			<address>Alexander Street, Vancouver, BC V6A 1E1, Canada<br>+1 310 666 8888<br>+1 310 666 9999<br><a href="mailto:store_1@companyname.com">store_1@companyname.com</a></address>\r\n		</div>\r\n		<div class="col-md-4">\r\n			<h4><i class="fa fa-map-marker"></i> Italy</h4>\r\n			<address>Pzza Martiri Olivetta, 16, 16034, Portofino, Italy<br>+1 310 666 8888<br>+1 310 666 9999<br><a href="mailto:store_1@companyname.com">store_1@companyname.com</a></address>\r\n		</div>\r\n	</div>\r\n	<hr class="tall">\r\n</div>', 'Contact Page Header', 'full_html'),
(7, '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d24211.70199537884!2d-73.9482136362959!3d40.66377185214051!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89c25b6f2cf5c117%3A0x97da648ac6054528!2sWinthrop+St!5e0!3m2!1sen!2s!4v1407399678598" width="100%" height="300" frameborder="0" style="border:0"></iframe>', 'Map', 'full_html');
